description:
Return to the days of magic, maidens, goblins and gold to help an unwitting knight and his feisty wife find the Fountain of Living Water. Only those players who figure out the quickest way through each level will win the gold! Are you ready to prove yourself? Then play this side-splitting time management epic today!
